import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import Products from './pages/Products';
import Categories from './pages/Categories';
import Users from './pages/Users';
import { AuthProvider } from './context/AuthContext';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route
            path="/dashboard"
            element={<ProtectedRoute roles={['admin', 'staff']}><Dashboard /></ProtectedRoute>}
          />
          <Route
            path="/products"
            element={<ProtectedRoute roles={['admin', 'staff']}><Products /></ProtectedRoute>}
          />
          <Route
            path="/categories"
            element={<ProtectedRoute roles={['admin']}><Categories /></ProtectedRoute>}
          />
          <Route
            path="/users"
            element={<ProtectedRoute roles={['admin']}><Users /></ProtectedRoute>}
          />
          <Route path="*" element={<Navigate to="/login" replace />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
